<style>
.button {
    background-color: #4285f4; /* Blue */
    border: none;
    color: white;
    text-align: center;
    width:88px;
    height:31px;
    overflow:hidden;
    text-decoration: none;
    display: inline-block;
    border-radius: 3px;
    line-height: 20px;
    font-size: 14px;
    position:relative;
    font-family:'Roboto',sans-serif;
    font-weight: 500;
    text-align:center;
    text-transform: uppercase;
    margin: 4px 2px;
    cursor: pointer;
    -webkit-transition-duration: 0.4s; /* Safari */
    transition-duration: 0.4s;
}


.button2:hover {
    box-shadow: 0 12px 16px 0 rgba(0,0,0,0.24),0 15px 19px 0 rgba(0,0,0,0.19);
}
